static std::string dword_str_to_str(const std::string& bytecode, const std::uint32_t offset) 
{
	std::string retn = "";

	for (auto i = 0u; i < 4u; ++i) 
	{

		char str[2];
		std::snprintf(str, sizeof(str), "%X", *reinterpret_cast<const std::uint8_t*>(bytecode.data() + offset + i));
		
		auto strin = std::string(str);
		if (strin.length() == 1u)
			strin.insert(strin.begin(), '0');
		
		retn += strin + ' ';

	}

	return retn;
}

void replace_sub_str(std::string& str, const char search, const char* const replace) 
{
	auto pos = 0u;
	while ((pos = str.find(search, pos)) != std::string::npos) 
	{
		str.replace(pos, sizeof(search), replace);
		pos += std::strlen(replace);
	}
}

/* Builds proto info. */
std::shared_ptr<decompile_info> build_decompiler_info(const std::string& bytecode, const std::size_t len) 
{
	std::vector<std::string> strings;
	std::vector<std::shared_ptr<decompile_info>> protos_ana;

	const auto version = bytecode.front ();

	auto ip = 1u;

	const auto string_count = std::uint32_t (decode_int(bytecode, ip));

	/* Set each string. */
	for (auto i = 0u; i < string_count; ++i)
	{
		const auto size = decode_int(bytecode, ip);
		const auto data = bytecode.data();

		std::string str_buffer ((data + ip),  size);
		strings.emplace_back(str_buffer);

		ip += size;
	}

	const auto protos = decode_int(bytecode, ip);

	for (auto p = 0u; p < protos; ++p) 
	{
		auto info = std::make_shared<decompile_info>();

		/* Skip to sizecode. */
		ip += 4u;

		const auto size_code = decode_int(bytecode, ip);
		info->proto.size_code = size_code;

		
		#if CONFIG_DEBUG_LOAD_PROTO_INFO_PRINT == true
			std::cout << "proto->sizecode " << std::to_string(size_code) << std::endl;
		#endif
		
		for (auto i = 0u; i < size_code; ++i)
		{
			const auto code = *reinterpret_cast<const std::uint32_t*>(bytecode.data() + ip);
			info->proto.code.emplace_back(code);
			info->pcode_bytes.emplace_back(dword_str_to_str(bytecode, ip));		 
			ip += 4u;
		}

		const auto size_k = decode_int(bytecode, ip);

		
		#if CONFIG_DEBUG_LOAD_PROTO_INFO_PRINT == true
			std::cout << "proto->sizek " << std::to_string(size_k) << std::endl;
		#endif	

		/* set proto->k */
		for (auto i = 0u; i < size_k; ++i)
		{
			const auto sub_op = bytecode[ip++];

			switch (sub_op) 
			{
				/* nil */
			    case 0: {
					info->proto.k.emplace_back("nil");
					break;
			    }

			    /* bool */
				case 1: {
					const auto kval = bytecode[ip++];
					info->proto.k.emplace_back(((kval) ? "true" : "false"));
					break;
				}

			    /* integer */
				case 2: {
					auto str = std::to_string(*reinterpret_cast<const double*>(bytecode.data() + ip));

					/* Remove 0's from to_string double. */
					str.erase(str.find_last_not_of('0') + 1, std::string::npos);
					if (str.back() == '.')
						str.pop_back();

					info->proto.k.emplace_back(str);
					ip += sizeof(double);
					break;
				}

			    /* string */
				case 3: {
					const auto str_id = decode_int(bytecode, ip);
					auto& strr = strings[(str_id - 1u)];
					
					/* Fix escape sequnces. */
					replace_sub_str(strr, '\\', "\\\\");
					replace_sub_str(strr, '\a', "\\a");
					replace_sub_str(strr, '\b', "\\b");
					replace_sub_str(strr, '\f', "\\f");
					replace_sub_str(strr, '\n', "\\n");
					replace_sub_str(strr, '\r', "\\r");
					replace_sub_str(strr, '\t', "\\t");
					replace_sub_str(strr, '\v', "\\v");
					replace_sub_str(strr, '\'', "\\'");
					replace_sub_str(strr, '\"', "\\\"");
					replace_sub_str(strr, '\?', "\\?");
				
					info->proto.k.emplace_back('\"' + strr + '\"');
					break;
				}

			    /* Import */
				case 4: {
					const auto id = *reinterpret_cast<const std::uint32_t*>(bytecode.data () + ip);
					const auto id_ = (((std::int32_t(id) >> 30) > 0) ? (std::int32_t(id >> 20) & 1023) : -1);
		
					ip += 4u;

					/* Safe gaurd. */
					if (id_ >= 0 && id_ <= std::int32_t (info->proto.k.size()))
						info->proto.k.emplace_back(info->proto.k[id_]);
					else
						info->proto.k.emplace_back("nil");
					
					break;
				}

				/* table */
				case 5: {
					/* Create a special encoding for it to process. */
		
					const auto id = decode_int(bytecode, ip);
					const auto compiled = std::to_string(id);

					for (auto i = 0u; i < id; ++i) 
						 decode_int(bytecode, ip);

					info->proto.k.emplace_back(compiled); /* Place hold for now. */
					break;
				}

				/* closure */
				case 6: {
					std::string compiled = "";
					const auto id = decode_int(bytecode, ip);
					
					/* Used for identifying closure. */
					compiled = "func_" + std::to_string(id);
					info->proto.k.emplace_back(compiled);
					break;
				}
			}
		}
		
		const auto size_p = decode_int(bytecode, ip);
		for (auto i = 0u; i < size_p; ++i) 
		{
			const auto id = decode_int(bytecode, ip);
			info->proto.p.emplace_back(protos_ana[id]);
		}

		info->proto.size_proto = size_p;

		#if CONFIG_DEBUG_LOAD_PROTO_INFO_PRINT == true
			std::cout << "proto->sizep " << std::to_string(size_p) << std::endl;
		#endif
			
		/* linedefined */
 		const auto line_defined_p = decode_int(bytecode, ip);
		const auto closure_name = decode_int(bytecode, ip);
		info->proto.closure.name = (!closure_name) ? "" : strings[closure_name - 1u];
		const auto lineinfo = bytecode[ip++];

		#if CONFIG_DEBUG_LOAD_PROTO_INFO_PRINT == true
			std::cout << "proto->debugname " << info->proto.closure.name << std::endl;
		#endif
		
		#if CONFIG_DEBUG_LOAD_PROTO_INFO_PRINT == true
			std::cout << "proto->linedefined " << std::to_string(line_defined_p) << std::endl;
		#endif

		if (lineinfo) 
		{
			const auto lineinfo_next = bytecode[ip++];
			const auto tsnr = std::int32_t(((size_code - 1) >> std::int32_t (lineinfo_next)) + 1);
			const auto abs = (std::int32_t(size_code + 3) & ~3);

			
			#if CONFIG_DEBUG_LOAD_PROTO_INFO_PRINT == true
				std::cout << "proto->linegaplog2 " << std::to_string(lineinfo_next) << std::endl;
			#endif	
			
			#if CONFIG_DEBUG_LOAD_PROTO_INFO_PRINT == true
				std::cout << "proto->sizelineinfo " << std::to_string(abs + tsnr * sizeof(int)) << std::endl;
			#endif	
			
			ip += (size_code + (4u * tsnr));
		}

	    auto debug = bytecode[ip++];
		info->proto.debug_info = debug;
				
		if (debug) 
		{
			const auto size_locvars = decode_int(bytecode, ip);

			#if CONFIG_DEBUG_LOAD_PROTO_INFO_PRINT == true
				std::cout << "proto->sizelocvars " << std::to_string(size_locvars) << std::endl;
			#endif
				
			for (auto i = 0u; i < size_locvars; ++i) 
			{
				auto ptr = std::make_shared<loc_var>();
				ptr->name = strings[(decode_int(bytecode, ip) - 1u)];
				ptr->end = (decode_int(bytecode, ip) - 1u);
				decode_int(bytecode, ip);
				ptr->reg =  bytecode[ip++];
				info->proto.locvars.emplace_back(ptr);
			}

			const auto size_upvalues_dbg = decode_int(bytecode, ip);

			#if CONFIG_DEBUG_LOAD_PROTO_INFO_PRINT == true
				std::cout << "proto->sizeupvalues " << std::to_string(size_upvalues_dbg) << std::endl;
			#endif	
			
			for (auto i = 0u; i < size_upvalues_dbg; ++i) 
			{

				const auto id = decode_int(bytecode, ip);
				const auto c_id = ((id) ? (id - 1u) : 0u);

				info->proto.upvalues.emplace_back((c_id > strings.size()) ? "" : strings[c_id]);

			}
			
			#if CONFIG_DISABLE_DEBUG == true
				debug = false;
				info->proto.debug_info = false;
				info->proto.locvars.clear();
				info->proto.upvalues.clear();
			#endif
		}
		
		info->proto.closure.is_child_proto = true;
		
		protos_ana.push_back(info);
	}

	const auto id = decode_int(bytecode, ip);

	const auto& main = protos_ana[id];
	main->proto.main_proto = id;
	main->proto.closure.is_child_proto = false;

    return main;
}


